import styled from "styled-components";

export const Container = styled.div`
  div.layout {
    height: 100%;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    padding: 15px;
  }

  div.content {
    margin: 0 16.66%;
    margin: 0 calc(100% / 6);
  }
`;
